oxy_webhelp_navlinks = {"work_spaces_to_handle_tasks-d1437e212":{"topics":[{"title":"Bank's Employee workspaces","shortdesc":"<p class=\"shortdesc\">Bank's Employee workspace is a desktop or a mobile page that is opened as bank's         employees log in to their banking application. Bank's Employee manage their banking         operations using Roles, so each role may have it's own workspace.<\/p>","href":"topics\/bank_s_employee_app_ui.html","attributes":{"data-id":"bank_s_employee_app_ui"},"menu":{"hasChildren":false},"tocID":"bank_s_employee_app_ui-d1437e223","topics":[]},{"title":"Bank's Corporate Client workspaces","shortdesc":"<p class=\"shortdesc\">Bank's Corporate Client workspace is a desktop or a mobile page that is opened as         bank's corporate clients log in to their internet banking application. Corporate clients         manage their banking operations using Roles, such as bookkeeper, CEO, CFO etc., so each role         may have it's own workspace.<\/p>","href":"topics\/bank_s_corporate_client_app_ui.html","attributes":{"data-id":"bank_s_corporate_client_app_ui"},"menu":{"hasChildren":true},"tocID":"bank_s_corporate_client_app_ui-d1437e234","next":"bank_s_corporate_client_app_ui-d1437e234"},{"title":"Bank's Private Client workspace","shortdesc":"<p class=\"shortdesc\">Bank's Private Client workspace is a desktop or a mobile page that is opened as         bank's private clients log in to their internet banking application. Private clients manage         their banking operations themselves so there is the only role - Private client and the only         workspace for the role.<\/p>","href":"topics\/bank_s_privat_client_app_ui.html","attributes":{"data-id":"bank_s_privat_client_app_ui"},"menu":{"hasChildren":true},"tocID":"bank_s_privat_client_app_ui-d1437e309","next":"bank_s_privat_client_app_ui-d1437e309"}]}};